/* eslint-disable @typescript-eslint/consistent-type-imports */
declare module "*.png" {
  const value: import("react-native").ImageSourcePropType;
  export default value;
}

declare module "*.jpg" {
  const value: import("react-native").ImageSourcePropType;
  export default value;
}

declare module "*.ttf" {
  const value: import("expo-font").FontSource;
  export default value;
}
